import { BrowserRouter, Routes, Route } from "react-router-dom";
import "../css/home.css"
function Home() {
  return (
  <>
    <div className="home-element-main-container">
      <div className="top-home-nav-bar">
        <div className="top-nav-home-options">
          <div className="top-nav-option ">Home</div>
        </div>
      </div>
    </div>
  </>
  )
}

export default Home;
